import '../index.css';
import './App.js';
import Header from './Header';
import Main from '../Main';
import Footer from './Footer';
import PopupWithForm from './PopupWithForm';

function App() {
  return (
    <div>
      <body className="page">
      <Header />
       <Main
       />
       <Footer />
       <PopupWithForm
       name='more-info'
       />
        <PopupWithForm
       name='more-item'
       />
       <PopupWithForm
       name='delete-card'
       />
        <PopupWithForm
       name='profile-avatar'
       />
      </body>
    </div>
  );
}
export default App;
